description:
Verenigde Staten
Animatie / Science-Fiction
103 minuten

mooie film

met de stemmen van Ben Burtt, Elissa Knight en Jeff Garlin

Het is het jaar 2815. Terwijl de mensheid de planeet Aarde vanwege oververvuiling heeft moeten verlaten, is het kleine robotje 
WALL-E in zijn eentje nog steeds bezig met het schoonmaken van de verlaten planeet. Elke dag weer maakt hij van de grote bergen 
afval kleine pakketjes en neemt de unieke spullen die hij tegenkomt in het vuilnis mee naar huis. Op een dag wordt de robot EVE 
naar de planeet Aarde gestuurd om te onderzoeken of het leven op de planeet weer mogelijk is.
